Magpie
```json
{
"application": "Magpie",
"software_dependencies": [
"Hadoop",
"HBase",
"Zookeeper"
],
"resource_requirements": {
"nodes": "<my_node_count>",
"time": "<my_time_in_minutes>",
"memory": {
"java": {
"heap_max": {
"hadoop_daemon": "1000m",
"hadoop_namenode": "2000m",
"hbase_master": "1000m",
"hbase_regionserver": "16000m or 50% of system memory, whichever is smaller"
}
},
"yarn": {
"container_memory": "32768m",
"child_heap": "2048m",
"child_map_heap": "2048m",
"child_reduce_heap": "4096m",
"child_map_container_buffer": "256m",
"child_reduce_container_buffer": "512m"
},
"zookeeper": {
"ticktime": "2000 milliseconds",
"initlimit": {
"local": "10",
"networkfs": "20"
},
"synclimit": {
"local": "5",
"networkfs": "10"
}
},
"hdfs": {
"replication": "3",
"blocksize": "134217728",
"path": "/ssd/${USER}/hdfs",
"cleanup": "yes"
},
"hdfsoverlustre": {
"path": "/lustre/${USER}/hdfsoverlustre/",
"ignore_lock": "yes"
},
"hdfsovernetworkfs": {
"path": "/networkfs/${USER}/hdfsovernetworkfs/",
"ignore_lock": "yes"
},
"rawnetworkfs": {
"path": "/lustre/${USER}/rawnetworkfs/",
"blocksize": "33554432"
},
"localstore": {
"path": "/ssd/${USER}/localstore/",
"cleanup": "yes"
},
"zookeeper_data_dir": {
"path": "/lustre/${USER}/zookeeper",
"cleanup": "yes",
"type": "networkfs"
},
"terasort": {
"size": "50000000",
"map_count": "4",
"reducer_count": "4",
"clear_cache": "yes",
"output_replication": "1",
"run_terachecksum": "no",
"run_teravalidate": "no"
},
"performanceeval": {
"mode": "sequential-thread",
"row_count": "1048576",
"client_count": "1"
},
"mpirun_options": "-genvall -genv MV2_USE_APM 0"
}
}
```
